INSERT INTO `vv_jobs` (`job_id`, `job_code`, `user_id`, `category_id`, `sub_category_id`, `job_title`, `job_salary`, `no_of_openings`, `job_type`, `job_interview_date`, `years_of_experience`, `job_interview_time`, `job_role`, `educational_qualification`, `job_description`, `job_small_description`, `job_location`, `job_company_name`, `company_logo`, `contact_person`, `contact_email_id`, `contact_number`, `contact_website`, `interview_location`, `skill_set`, `job_status`, `seo_title`, `seo_description`, `seo_keywords`, `job_slug`, `job_udt`, `job_cdt`) VALUES
(5, 'JOB005', 323, '54', '51', 'Full Stack Web Developer', 1000, 2, 1, '2021-08-28', 5, '09:45:00', 'Senior Developer', 'B.tech, B.E, BSC', 'The official marketing, tourism and partnership organization for the City of New York, NYC & Company is dedicated to maximizing travel and tourism opportunities throughout the five boroughs, building economic prosperity and spreading the positive image of New York City worldwide.\r\n\r\nThe ideal candidate for this role should be comfortable working on a multidisciplinary team, in a fast-paced, highly-demanding environment. S/he will work closely with a team of developers and project managers to develop software solutions and interfaces for our award winning website (www.nycgo.com) and other digital properties.\r\n\r\nThe Full Stack Web Developer must have a strong understanding of Javascript frameworks and some backend programming combined with the ability to research, optimize and advance existing website markup code. This individual will work directly with the development team to establish new methods and standards to grow our business in an agile environment. The ideal candidate will be a major asset and contributor to the team as we continue to grow our product line and optimize for future growth.\r\n', 'NYC & Company is seeking a Full Stack Web Developer to join its Digital Product Development team full time.\r\n', 1, 'NYCA & Company', '60226rn53-themes.png', 'Andriya Joe', 'webdevelop@softwares.com', '987654321', 'https://rn53themes.net/', '', '38,37,36,35,34,33', 'Active', '', '', '', 'Full Stack Web Developer', '2021-08-09 19:45:14', '2021-08-09 19:45:14'),
(6, 'JOB006', 323, '54', '52', 'Graphic Designer', 2000, 5, 1, '2021-09-04', 0, '07:50:00', 'Junior ', 'BE, BCA', 'Denodo is looking for a passionate and talented Graphic Designer to join our creative team in Chennai. We are seeking a designer with professional drive, curiosity, and excellent teamwork skills. You must be eager to learn and contribute on a variety of levels.\r\n\r\nThis role involves in-house design creation of communication assets aligned with our marketing strategies and branding guidelines. You will work across a wide range of creative disciplines including: branding, design for events, web design, digital and print design. You must have a solid background in visual communications and an understanding of typography, layout and current design trends.\r\n\r\nThis is a great opportunity to work closely with a team of driven and experienced marketing professionals to help Denodo share its message worldwide.\r\n\r\nDuties and Responsibilities\r\n• Work creatively within guidelines and existing assets.\r\n• Design marketing/product materials such as documents, brochures, infographics, sales presentations, flyers, tradeshow booths, emails, digital and social media promotions.\r\n• Contribute to the design and maintenance of company websites and microsites.\r\n• Create and edit videos for websites, webinars, and virtual events.\r\n• Manage projects from start to finish.\r\n• Meet deadlines and accomplish tasks as needed.\r\n', 'Denodo is the leader in data virtualization – providing unmatched performance, unified access to the broadest range of enterprise, Big Data, cloud and unstructured sources, and the agilest data services provisioning and governance – at less than half the cost of traditional data integration. Denodo’s customers have gained significant business agility and ROI by creating a unified virtual data layer that serves strategic enterprise-wide information needs for agile BI, big data analytics, web and cloud integration, single-view applic