(1, 'New User Register (User)', 'mail_user_new_register', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n\r\n<head>\r\n	<meta http-equiv=\"Content-Type\" content=\"text/html\" charset=\"utf-8\">\r\n	<title>Bizbook Mailers</title>\r\n</head>\r\n\r\n<body id=\"page-top\" class=\"index\">\r\n    <table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"width:100%;font-size:14px;font-family:Quicksand, Calibri, Arial, Verdana, sans-serif;background: #f5f6fa;color:#738196;line-height: 21px;padding: 30px;\">\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <table style=\"background: #fff;width:500px;padding: 20px;margin: 0 auto;box-shadow: 0px 1px 10px 13px #2d313703;border-radius: 8px;font-weight: 500;\">\r\n                        <tbody>\r\n                        <tr>\r\n                            <td style=\"font-size: 24px;color:#000;font-weight: bold;line-height: 30px;\">Welcome to <span contenteditable=\"false\">\'.$admin_site_name.\'</span></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"font-size: 18px;color:#000;font-weight: bold;line-height: 26px;\">Thank you for registering with us.</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"height: 5px;line-height: 2px;\">&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Click the below link and enter below code to verify your email id and start your online business now.</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Verification Code : <b>\'.$verify_code.\'</b></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><a href=\"\'.$webpage_full_link_with_verification_link.\'\" style=\"font-size: 15px;background: #fae73d;color: #000;font-weight: bold;width: 110px;border-radius: 50px;display: inline-block;text-align: center;cursor: pointer;text-decoration: none;padding: 8px 5px;\">Verify now</a></td>\r\n                        </tr>\r\n                        <tr><td>&nbsp;</td></tr>\r\n                        <tr>\r\n                            <td>Thanks, <br><span contenteditable=\"false\">\'.$admin_site_name.\'</span></td>\r\n                        </tr>\r\n                    </tbody></table>\r\n                </td>\r\n            </tr>\r\n\r\n        </tbody>\r\n    </table>\r\n</body>\r\n\r\n</html>'),
(2, 'New User Register (Admin)', 'mail_admin_new_register', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n\r\n<head>\r\n	<meta http-equiv=\"Content-Type\" content=\"text/html\" charset=\"utf-8\">\r\n	<title>Bizbook Mailers</title>\r\n</head>\r\n\r\n<body id=\"page-top\" class=\"index\">\r\n    <table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"width:100%;font-size:14px;font-family:Quicksand, Calibri, Arial, Verdana, sans-serif;background: #f5f6fa;color:#738196;line-height: 21px;padding: 30px;\">\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <table style=\"background: #fff;width:500px;padding: 20px;margin: 0 auto;box-shadow: 0px 1px 10px 13px #2d313703;border-radius: 8px;font-weight: 500;\">\r\n                        <tbody>\r\n                        <tr>\r\n                            <td style=\"font-size: 24px;color:#000;font-weight: bold;line-height: 30px;\">A new registration has been made</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"height: 5px;line-height: 2px;\">&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Dear admin one new user has been registered in your website. Please find the user details below</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"font-size: 20px;color:#000;font-weight: bold;line-height: 26px;\">User informations:</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><strong>Name:</strong><span contenteditable=\"false\">\' . $first_name . \'</span></td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><strong>Email id:</strong><span contenteditable=\"false\">\' . $email_id . \'</span></