dding: 25px 0 10px\r\n    }\r\n\r\n    .discount {\r\n        width: 100%;\r\n        margin: 0;\r\n        padding: 24px;\r\n        -premailer-width: 100%;\r\n        -premailer-cellpadding: 0;\r\n        -premailer-cellspacing: 0;\r\n        background-color: #F4F4F7;\r\n        border: 2px dashed #CBCCCF\r\n    }\r\n\r\n    .discount_heading {\r\n        text-align: center\r\n    }\r\n\r\n    .discount_body {\r\n        text-align: center;\r\n        font-size: 15px\r\n    }\r\n\r\n    .social {\r\n        width: auto\r\n    }\r\n\r\n    .social td {\r\n        padding: 0;\r\n        width: auto\r\n    }\r\n\r\n    .social_icon {\r\n        height: 20px;\r\n        margin: 0 8px 10px;\r\n        padding: 0\r\n    }\r\n\r\n    .purchase {\r\n        width: 100%;\r\n        margin: 0;\r\n        padding: 35px 0;\r\n        -premailer-width: 100%;\r\n        -premailer-cellpadding: 0;\r\n        -premailer-cellspacing: 0\r\n    }\r\n\r\n    .purchase_content {\r\n        width: 100%;\r\n        margin: 0;\r\n        padding: 25px 0 0;\r\n        -premailer-width: 100%;\r\n        -premailer-cellpadding: 0;\r\n        -premailer-cellspacing: 0\r\n    }\r\n\r\n    .purchase_item {\r\n        padding: 10px 0;\r\n        color: #51545E;\r\n        font-size: 15px;\r\n        line-height: 18px\r\n    }\r\n\r\n    .purchase_heading {\r\n        padding-bottom: 8px;\r\n        border-bottom: 1px solid #EAEAEC\r\n    }\r\n\r\n    .purchase_heading p {\r\n        margin: 0;\r\n        color: #85878E;\r\n        font-size: 12px\r\n    }\r\n\r\n    .purchase_footer {\r\n        padding-top: 15px;\r\n        border-top: 1px solid #EAEAEC\r\n    }\r\n\r\n    .purchase_total {\r\n        margin: 0;\r\n        text-align: right;\r\n        font-weight: 700;\r\n        color: #333\r\n    }\r\n\r\n    .purchase_total--label {\r\n        padding: 0 15px 0 0\r\n    }\r\n\r\n    body {\r\n        background-color: #F4F4F7;\r\n        color: #51545E\r\n    }\r\n\r\n    p {\r\n        color: #51545E\r\n    }\r\n\r\n    p.sub {\r\n        color: #6B6E76\r\n    }\r\n\r\n    .email-wrapper {\r\n        width: 100%;\r\n        margin: 0;\r\n        padding: 0;\r\n        -premailer-width: 100%;\r\n        -premailer-cellpadding: 0;\r\n        -premailer-cellspacing: 0;\r\n        background-color: #F4F4F7\r\n    }\r\n\r\n    .email-content {\r\n        width: 100%;\r\n        margin: 0;\r\n        padding: 0;\r\n        -premailer-width: 100%;\r\n        -premailer-cellpadding: 0;\r\n        -premailer-cellspacing: 0\r\n    }\r\n\r\n    .email-masthead {\r\n        padding: 25px 0;\r\n        text-align: center\r\n    }\r\n\r\n    .email-masthead_logo {\r\n        width: 94px\r\n    }\r\n\r\n    .email-masthead_name {\r\n        font-size: 16px;\r\n        font-weight: 700;\r\n        color: #A8AAAF;\r\n        text-decoration: none;\r\n        text-shadow: 0 1px 0 #fff\r\n    }\r\n\r\n    .email-body {\r\n        width: 100%;\r\n        margin: 0;\r\n        padding: 0;\r\n        -premailer-width: 100%;\r\n        -premailer-cellpadding: 0;\r\n        -premailer-cellspacing: 0;\r\n        background-color: #FFF\r\n    }\r\n\r\n    .email-body_inner {\r\n        width: 570px;\r\n        margin: 0 auto;\r\n        padding: 0;\r\n        -premailer-width: 570px;\r\n        -premailer-cellpadding: 0;\r\n        -premailer-cellspacing: 0;\r\n        background-color: #FFF\r\n    }\r\n\r\n    .email-footer {\r\n        width: 570px;\r\n        margin: 0 auto;\r\n        padding: 0;\r\n        -premailer-width: 570px;\r\n        -premailer-cellpadding: 0;\r\n        -premailer-cellspacing: 0;\r\n        text-align: center\r\n    }\r\n\r\n    .email-footer p {\r\n        color: #6B6E76\r\n    }\r\n\r\n    .body-action {\r\n        width: 100%;\r\n        margin: 30px auto;\r\n        padding: 0;\r\n        -premailer-width: 100%;\r\n        -premailer-cellpadding: 0;\r\n        -premailer-cellspacing: 0;\r\n        text-align: center\r\n    }\r\n\r\n    .body-sub {\r\n        margin-top: 25px;\r\n        padding-top: 25px;\r\n        border-top: 1px solid #EAEAEC\r\n    }\r\n\r\n    .content-cell {\r\n        padding: 35px\r\n    }\r\n\r\n    @media only screen and (max-width: 600px) {\r\n        .email-body_inner, .email-footer {\r\n            width: 100% !important\r\n        }\r\n    }\r\n\r\n    @media (prefers-color-scheme: dark) {\r\n        body, .email-body, .email-body_inner, .email-content, .email-wrapper, .email-masthead, .email-footer {\r\n            background-color: #333 !important;\r\n            color: #FFF !important\r\n        }\r\n\r\n        p, ul, ol, blockquote, h1, h2, h3 {\r\n            color: #FFF !important\r\n        }\r\n\r\n        .attributes_content, .discount {\r\n            background-color: #222 !important\r\n        }\r\n\r\n        .email-masthead_name {\r\n            text-shadow: none !important\r\n        }\r\n    }     </style>\r\n<style type=\"text/css\">       .f-fallback {\r\n        font-family: Arial, sans-serif;\r\n    }     </style>     \r\n<span class=\"preheader\">Thanks for trying out <span contenteditable=\"false\">\'.$admin_site_name.\'</span>. Weï¿½ve pulled together some information and resources to help you get started.</span>\r\n<table class=\"email-wrapper\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\" style=\"width: 100%;margin: 0;padding: 0;background-color: #F4F4F7;\">\r\n    <tbody><tr>\r\n        <td align=\"center\">\r\n            <table class=\"email-content\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\">\r\n                <tbody><tr>\r\n                    <td class=\"email-masthead\" style=\"padding: 25px 0;text-align: center;\"><a href=\"\'.$webpage_full_link.\'\" class=\"f-fallback email-masthead_name\" style=\"font-size: 16px;font-weight: 700;color: #A8AAAF;text-decoration: none;text-shadow: 0 1px 0 #fff;\">\r\n                            <span contenteditable=\"false\">\'.$admin_site_name.\'</span> </a></td>\r\n                </tr>                 <!-- Email Body -->\r\n                <tr>\r\n                    <td class=\"email-body\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;margin: 0;padding: 0;background-color: #FFF;\">\r\n                        <table class=\"email-body_inner\" align=\"center\" width=\"570\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\" style=\"width: 570px;margin: 0 auto;padding: 0;background-color: #FFF;\">\r\n                            <!-- Body content -->\r\n                            <tbody><tr>\r\n                                <td class=\"content-cell\" style=\"padding: 35px;\">\r\n                                    <div class=\"f-fallback\"><h1>Hi, <span contenteditable=\"false\">\' . $first_name . \'</span>!</h1>\r\n                                        <p>Thanks for updating <span contenteditable=\"false\">\' . $product_name . \'</span>.Your Product has been successfully\r\n                                            updated.</p>                                         <!-- Action --> <p>For\r\n                                            reference, here\'s your blog information:</p>\r\n                                        <table class=\"attributes\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\" style=\"margin: 0 0 21px;\">\r\n                                            <tbody><tr>\r\n                                                <td class=\"attributes_content\" style=\"background-color: #F4F4F7;padding: 16px;\">\r\n                                                    <table width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\">\r\n                                                        <tbody><tr>\r\n                                                            <td class=\"attributes_item\" style=\"line-height: 28px;\"><span class=\"f-fallback\">               <strong> Product name:</strong> <span contenteditable=\"false\">\' . $product_name . \'</span>             </span>\r\n                                                            </td>\r\n                                                        </tr>\r\n                                                        <tr>\r\n                                                            <td class=\"attributes_item\" style=\"line-height: 28px;\"><span class=\"f-fallback\">               <strong>Mobile Number :</strong> <span contenteditable=\"false\">\' . $listing_mobile . \'</span>             </span>\r\n                                                            </td>\r\n                                                        </tr>\r\n                                                        <tr>\r\n                                                            <td class=\"attributes_item\" style=\"line-height: 28px;\"><span class=\"f-fallback\">               <strong>Email Id :</strong> <span contenteditable=\"false\">\' . $email_id . \'</span>             </span>\r\n                                                            </td>\r\n                                                        </tr>\r\n                                                    </tbody></table>\r\n                                                </td>\r\n                                            </tr>\r\n                                        </tbody></table>\r\n                                        <p>You can login into your dashboard then you check all details of Product.</p>\r\n                                        <!-- Action -->\r\n                                        <table class=\"body-action\" align=\"center\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\" style=\"width: 100%;margin: 30px auto;padding: 0;\">\r\n                                            <tbody><tr>\r\n                                                <td align=\"center\">\r\n                                                    <table width=\"100%\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" role=\"presentation\">\r\n                                                        <tbody><tr>\r\n                                                            <td align=\"center\"><a href=\"\'.$webpage_full_link_with_login.\'\" class=\"f-fallback button\" target=\"_blank\" style=\"background-color:#3869D4;border-top:10px solid #3869D4;border-right:18px solid #3869D4;border-bottom:10px solid #3869D4;border-left:18px solid #3869D4;display:inline-block;color:#FFF;text-decoration:none;border-radius:3px;box-shadow:0 2px 3px rgba(0,0,0,0.16);-webkit-text-size-adjust:none;box-sizing:border-box;\">Access\r\n                                                                    your dashboard</a></td>\r\n                                                        </tr>\r\n                                                    </tbody></table>\r\n                                                </td>\r\n                                            </tr>\r\n                                        </tbody></table>\r\n                                        <p>If you have any questions, feel free to <a href=\"mailto:{{support_email}}\">email\r\n                                                our customer success team</a>. (We\'re lightning quick at replying .)\r\n                                        </p>\r\n                                        <p> Thanks, <br> <span contenteditable=\"false\">\'.$admin_site_name.\'</span> Team</p>\r\n                                        <p><strong>P.S.</strong> Need immediate help getting started? Check out our <a href=\"\'.$webpage_full_link.\'\">help documentation</a>. Or, just reply to\r\n                                            this email, the <span contenteditable=\"false\">\'.$admin_site_name.\'</span> support team is always ready to help!\r\n                                        </p>                                         <!-- Sub copy -->\r\n                                        <table class=\"body-sub\" role=\"presentation\" style=\"margin-top: 25px;padding-top: 25px;border-top: 1px solid #EAEAEC;\">\r\n                                            <tbody><tr>\r\n                                                <td><p class=\"f-fallback sub\">If your having trouble with the button\r\n                                                        above, copy and paste the URL below into your web browser.</p>\r\n                                                    <p contenteditable=\"false\" class=\"f-fallback sub\">\'.$webpage_full_link.\'</p></td>\r\n                                            </tr>\r\n                                        </tbody></table>\r\n                                    </div>\r\n                                </td>\r\n                            </tr>\r\n                        </tbody></table>\r\n                    </td>\r\n                </tr>\r\n                <tr>\r\n                    <td>\r\n                        <table class=\"email-footer\" align=\"center\" width=\"570\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\" style=\"width: 570px;margin: 0 auto;padding: 0;\">\r\n                            <tbody><tr>\r\n                                <td contenteditable=\"false\" class=\"content-cell\" align=\"center\" style=\"padding: 35px;\"><p class=\"f-fallback sub align-center\">Â© \r\n                                        \'.$admin_site_name.\'. All rights reserved.</p>\r\n                                    <p contenteditable=\"false\" class=\"f-fallback sub align-center\"> \'.$admin_site_name.\' <br>\'.$admin_address.\'\r\n                                    </p></td>\r\n                            </tr>\r\n                        </tbody></table>\r\n                    </td>\r\n                </tr>\r\n            </tbody></table>\r\n        </td>\r\n    </tr>\r\n</tbody></table>\r\n                    '),
(21, 'Product Edit (Admin)', 'mail_admin_edit_product', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n\r\n<head>\r\n	<meta http-equiv=\"Content-Type\" content=\"text/html\" charset=\"utf-8\">\r\n	<title>Bizbook Mailers</title>\r\n</head>\r\n\r\n<body id=\"page-top\" class=\"index\">\r\n   <table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"width:100%;font-size:14px;font-family:Quicksand, Calibri, Arial, Verdana, sans-serif;background: #f5f6fa;color:#738196;line-height: 21px;padding: 30px;\">\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <table style=\"background: #fff;width:500px;padding: 20px;margin: 0 auto;box-shadow: 0px 1px 10px 13px #2d313703;border-radius: 8px;font-weight: 500;\">\r\n                        <tbody>\r\n                        <tr>\r\n                            <td style=\"font-size: 24px;color:#000;font-weight: bold;line-height: 30px;\">Dear Admin,</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td style=\"height: 5px;line-height: 2px;\">&nbsp;</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>An Existing <span contenteditable=\"false\">\' . $product_name . \'</span>. has been successfully updated. For reference, here\'s your blog information:</td>\r\n                        </tr>     \r\n                        <tr><td>&nbsp;</td></tr>        \r\n                        <tr>\r\n                            <td style=\"font-size: 18px;color:#000;font-weight: bold;line-height: 26px;\">Product informations:</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td><strong> Name:</strong> <span contenteditable=\"false\">\' . $product_name . \'</span></td>\r\n                        </tr>     \r\n                        <tr>\r\n                            <td><strong>Price :</strong> <span contenteditable=\"false\">\' . $product_price . \'</span></