(4, 20, 'Kiribatii goes into first lockdown after Covid flight cases', 'The remote island nation of Kiribati has gone into lockdown after passengers on the first international flight in 10 months tested positive for Covid.\r\n\r\nUnder the new measures, people have been told to stay at home and social gatherings are banned.\r\n\r\nSome 36 people on the flight from Fiji have tested positive. Four people have caught the virus from community transmission.\r\n\r\nUntil last week, Kiribati had recorded just two Covid cases.\r\n\r\nKiribati is one of the most isolated islands in the world. It is some 5,000km (3,100 miles) from its nearest continent, North America.\r\n\r\nOn Tuesday, the government confirmed that 36 of the 54 passengers had tested positive. It said in a post on Facebook that all passengers are currently being monitored by health officials..\r\n\r\nAll of the passengers on the flight are fully vaccinated, the government said.\r\n\r\nHowever three members of the quarantine facility\'s security team have since tested positive. Another person who does not work at the facility has also contracted the virus, the government said.\r\n\r\nThe lockdown came into force on Saturday but it is not clear how long it will last.\r\n\r\nPeople are not allowed to leave their homes unless for essential services. They can buy essential items from shops but only between 06:00 and 14:00.\r\n\r\n', '28270pexels-pixabay-164041.jpg', '', '', '', 'Active', 'Kiribatii goes into first lockdown after Covid flight cases', '2022-01-22 20:14:27'),
(5, 23, 'Amazan Alexa returns after morning snooze', 'Users of Amazon\'s Alexa complained that the voice assistant was not working on Friday morning.\r\n\r\nAccording to the website Down Detector, the problem appeared to affect the UK and parts of Europe and lasted about an hour.\r\n\r\nSome users posted on social media that they had been unable to get Alexa to respond or help with their morning routine.\r\n\r\nAmazon said the problem had been resolved.\r\n\r\n\"This morning we had an issue that impacted some Alexa customers\' ability to interact with the service. The Alexa service is now operating normally,\" the company said in a statement.\r\n\r\nAlexa powers Amazon\'s Echo smart speakers, which launched in 2014.\r\n\r\nBBC Click presenter Lara Lewington said she had been unable to turn off her morning alarm because the voice assistant was not responding.\r\n\r\n', '21313pexels-pixabay-248021.jpg', '', '', '', 'Active', 'Amazan Alexa returns after morning snooze', '2022-01-22 20:17:41'),
(6, 22, 'Applee AirTags - \'A perfect tool for stalking\'', 'Amber Norsworthy lives in Mississippi with her four children.\r\n\r\nIt had just turned 3pm when she got home on 27 December. She received a notification on her phone.\r\n\r\n\"My phone made a ding that I\'d never heard before\", she says.\r\n\r\nThe notification told her that an unknown device had been following her movements.\r\n\r\nMs Norsworthy, who\'s 32, went on to the \'Find My\' app on her iPhone.\r\n\r\n\"It showed me my whole route. It said \'the last time the owner saw your location was 15:02\' and I was like, \'that\'s now, I\'m at home\'.\"\r\n\r\n', '26117pexels-kaboompics-com-6444.jpg', '', '', '', 'Active', 'Applee AirTags     A perfect tool for stalking', '2022-01-22 20:19:39'),
(7, 22, 'Like a drone that you sit in – but would you feel safe?', '\"Absolutely, that has been an important inspiration for me,\" says Mr Ternstrom, who co-founded Swedish firm Jetson with Tomasz Patan.\r\n\r\nRecently, his company released a video of its prototype personal flying machine, the Jetson ONE, in action. The clip quickly clocked more than 12m views on YouTube in about four weeks.\r\n\r\nThe filming location, a desert-like area, was deliberately chosen for its sci-fi feel. It is actually a military training ground in Poland.\r\n\r\nA helmeted pilot sits in the centre of what looks like a large drone, with its multiple spinning rotors. The craft zooms across the landscape, blowing up dust.\r\n\r\nThis is an electric vertical take-off and landing vehicle, or eVTOL. Personal eVTOLs are among the smallest rideable aircraft around and generally have capacity to transport just one passenger - the pilot.\r\n\r\nThe vehicle\'s diminutive size helps to keep down their price tag but there is another advantage for firms seeking to sell them. In the US, the Federal Aviation Administration (FAA) says that ultra-light vehicles - which weigh less than 254lbs (115kg) and have a maximum speed of 55kts (63mph; 101km/h) - can be flown without a pilot\'s certificate.', '90994pexels-josh-sorenson-378268.jpg', '', '', '', 'Active', 'Like a drone that you sit in     but would you feel safe', '2022-01-22 20:22:19'),
(8, 19, 'South Georgiea: The museum at the end of the world reopens for business', 'On the icy, southern edge of the Atlantic Ocean, just above the Antarctic circle, is a British island, a ghost town, and a museum.\r\n\r\nThe island is a tough place to work. The nearest airport is a four-day boat ride away. Fresh food is rare, the internet is \"poor to non-existent\" and, at times, the wind is strong enough to tip over helicopters.\r\n\r\nThere are no permanent residents on South Georgia, just 20 or so workers, from scientists to maintenance staff. But despite the remoteness, and the pandemic, its museum has reopened to visitors.\r\n\r\nIt\'s not easy running a museum at the end of the world. But this - from week-long commutes to imports of frozen cheese - is how they do it.On the icy, southern edge of the Atlantic Ocean, just above the Antarctic circle, is a British island, a ghost town, and a museum.\r\n\r\nThe island is a tough place to work. The nearest airport is a four-day boat ride away. Fresh food is rare, the internet is \"poor to non-existent\" and, at times, the wind is strong enough to tip over helicopters.\r\n\r\nThere are no permanent residents on South Georgia, just 20 or so workers, from scientists to maintenance staff. But despite the remoteness, and the pandemic, its museum has reopened to visitors.\r\n\r\nIt\'s not easy running a museum at the end of the world. But this - from week-long commutes to imports of frozen cheese - is how they do it.\r\nOn the icy, southern edge of the Atlantic Ocean, just above the Antarctic circle, is a British island, a ghost town, and a museum.\r\n\r\nThe island is a tough place to work. The nearest airport is a four-day boat ride away. Fresh food is rare, the internet is \"poor to non-existent\" and, at times, the wind is strong enough to tip over helicopters.\r\n\r\nThere are no permanent residents on South Georgia, just 20 or so workers, from scientists to maintenance staff. But despite the remoteness, and the pandemic, its museum has reopened to visitors.\r\n\r\nIt\'s not easy running a museum at the end of the world. But this - from week-long commutes to imports of frozen cheese - is how they do it.', '13439pexels-nadexriotic-3551498.jpg', '', '', '', 'Active', 'South Georgiea  The museum at the end of the world reopens for business', '2022-01-22 20:24:05'),
(9, 20, 'Covid: Face mask rules and Covid passes to end in World', 'The prime minister also said the government would immediately drop its advice for people to work from home.\r\n\r\nThe PM said England was reverting to \"Plan A\" due to boosters and how people had followed Plan B measures.\r\n\r\nHe told MPs scientists believed the Omicron wave had peaked nationally.\r\n\r\nAt a Downing Street press conference, Health Secretary Sajid Javid said: \"This is a moment we can all be proud of.\r\n\r\n\"It\'s a reminder of what this country can accomplish when we all work together.\"\r\n\r\nBut, he said, this should not be seen as the \"finish line\" because the virus and future variants cannot be eradicated - instead \"we must learn to live with Covid in the same way we live with flu\".\r\n\r\nHe urged people to continue taking steps to keep the virus at bay, including hand washing, ventilating rooms and self-isolating if positive - and pressed those who were unvaccinated to come forward to get their jabs.\r\n\r\n', '16302pexels-markus-spiske-3970332.jpg', 'Covid: Face mask rules and Covid passes to end in World', 'Covid: Face mask rules and Covid passes to end in World Covid: Face mask rules and Covid passes to end in World', 'covid, covid19, mask rules', 'Active', 'Covid  Face mask rules and Covid passes to end in World', '2022-01-22 20:26:14');
